import React from 'react';

const Breadcrumb = ({ items }) => {
    return (
        <nav aria-label="breadcrumb">
            <ol className="breadcrumb">
                {items.map((item, index) => (
                    <li key={index} className="breadcrumb-item">
                        {item.text}
                    </li>
                ))}
            </ol>
        </nav>
    );
};

export default Breadcrumb;
